=query {
  cashTrackingSessions(first: 5, after: {{ $if($json.endCursor, `"${$json.endCursor}"`, "null") }}
) {
    edges {
      node {
        id
        location { id name }
        closingBalance { amount }
        closingNote
        closingTime
        openingBalance { amount }
        openingNote
        openingTime

        totalCashSales { amount }
        totalCashRefunds { amount }
        totalDiscrepancy { amount }
        totalAdjustments { amount }
        expectedOpeningBalance { amount }
        expectedClosingBalance { amount }
        expectedBalance { amount }
        netCashSales { amount }
        cashTransactions (first: 100) { edges { node { order { name } } } }
        cashTrackingEnabled
        registerName

        adjustments(first: 100, after: null) {
          edges {
            node {
              cash {
                amount
              }
              note
              time
            }
          }
          pageInfo {
            hasNextPage
            endCursor
          }
        }
      }
    }
    pageInfo {
      hasNextPage
      endCursor
    }
  }
}

